import { updateObject } from '../utility';

const initialState = {
    //data
    employees: null,
    newEmployee: null,
    roles: null,
    selectedEmployee: null,
    //loading ui handling
    loading: false,
    fetchRolesLoading: false,
    saveEmployeeLoading: false,
    fetchEmployeeLoading: false,
    //error handling
    fetchAllEmployeesError: null,
    fetchEmployeeError: null,
    fetchRolesError: null,
    saveEmployeeError: null,
    
};

const reducer = (state = initialState, action) => {
    switch (action.type) {
        default: return state;
    }
};

export default reducer;
